// Daily Question: 2025-04-25
// #2845. Count of Interesting Subarrays
// https://leetcode.com/problems/count-of-interesting-subarrays/description/?envType=daily-question&envId=2025-04-25


"use strict"


/**
 * @param {number[]} nums
 * @param {number} modulo
 * @param {number} k
 * @return {number}
 */
function countInterestingSubarrays(nums, modulo, k) {
	let moduloCount = new Array(nums.length);
	for (let i = 0; i < nums.length; i++) {
		moduloCount[i] = nums[i] % modulo === k ? 1 : 0;
	}
	let interestingCount = 0
	for (let i = 0; i < nums.length; i++) {
		let subarrayCount = 0;
		for (let j = i; j < nums.length; j++) {
			subarrayCount += moduloCount[j]
			if(subarrayCount % modulo === k){
				interestingCount++;
			}
		}
	}
	return interestingCount;
};


console.log(countInterestingSubarrays([3, 2, 4], 2, 1));
// expected: 3
console.log('-------------------------------------------------------');

